//code for switching to the in game gamestate
void Menu::StartButton()
{
	//go to the game
	gameState = E_GAME_STATE_IN_GAME;
}

//code for exiting the game
void Menu::QuitButton()
{
	//quit the game
	exit(0);
}

//container holding information for each button
struct menu 
{

	CHAR_INFO buttonSprite[5184]; //sprite to use
	Vector2 size; //size of sprite
	Sprite* sprite = new Sprite(); //sprite to use

	double xPositionLerp = 0; //for lerping position
	double xPositionTarget = 40; //target this position when lerping xPositionLerp

}start, quit;

//intialises the menu
void Menu::Initialise(ASCIIRenderer* renderer, ParticlePixelPool* particlePixelPool)
{

	//set renderer
	m_pRenderer = renderer;

	//initialise logo
	logoSprite = new Sprite();
	logoSprite->Initialise(sprLogo, Vector2(202,67));

	//copy the sprites to the appropriate locatons in memory, specifically for each button struct
	memcpy(start.buttonSprite, sprStartButton, sizeof(sprStartButton));
	memcpy(quit.buttonSprite, sprQuitButton, sizeof(sprQuitButton));

	//set the size of the buttons - each sprite is the same size
	start.size = Vector2(192, 27);
	quit.size = Vector2(192, 27);

}

//updates the menu
//handles controlling movement and controlling what the buttons actually do
void Menu::Update()
{

	//cooldown so that it is easier to navigate the menus - buttons won't move too quickly
	buttonCooldown -= 1;

	//this method will change the currently selected button depending on the button pressed
	if (buttonCooldown <= 0)
	{

		if (GetKeyState(VK_UP) < 0 && menuIndex > 0)
		{

			menuIndex -= 1;
			buttonCooldown = 5;

		}
		else if (GetKeyState(VK_DOWN) < 0 && menuIndex < 1)
		{

			menuIndex += 1;
			buttonCooldown = 5;

		}

		//execute the button function depending on selected button
		if (GetKeyState(VK_SPACE) < 0)
		{

			switch (menuIndex)
			{
				case 0:

					StartButton();

					break;

				case 1:

					QuitButton();

					break;
			}

		}
	}

}

void Menu::Draw()
{

	//render game logo/title
	logoSprite->SetPosition(10, 10);
	logoSprite->Render(m_pRenderer);

	//render menu
	std::vector<menu> menuButtons; //create a vector for the menu
	menuButtons.push_back(start); //push the start button to the back of it (first index)
	menuButtons.push_back(quit); //push the quit button to the back of it (second index)

	for (int i = 0; i < 2; i++) //for each menu struct in the menuButtons vector...
	{

		menu button = menuButtons[i]; //set a variable to the current menu button index

		//if the current button in the for loop is not selected
		if (menuIndex != i)
		{
			//lerp it back to the starting position
			button.xPositionLerp = Lerp(button.xPositionLerp, 0, 1);
		}
		//if the current button in the for loop is selected
		else
		{
			//lerp it to the offset position in the struct
			button.xPositionLerp = Lerp(button.xPositionLerp, button.xPositionTarget, 1);
		}			

		button.sprite->Initialise(button.buttonSprite, button.size); //initialise that button's sprite
		button.sprite->SetPosition(270 - button.xPositionLerp, 10 + (40 * i)); //set it's position
		button.sprite->Render(m_pRenderer); //render the button sprite

	}

}

//calculates liner interpolation between A and B, with a speed of T
//A = point 1, B = point 2, T = speed
double Menu::Lerp(float _a, float _b, float _t)
{
	//calculates the movement/speed per frame from A to B
	return ((1 - _t) * _a) + (_t * _b);
}